desc:
Returns whether this stack is always allowed to edit the world. Forces {@link net.minecraft.entity.player.EntityPlayer#canPlayerEdit EntityPlayer#canPlayerEdit} to return {@code true}.

@return whether this stack ignores other restrictions on how a player can modify the world.
@see Item#canItemEditBlocks

Returns whether the current item is damageable. Used by tools, armor, bows, etc.
@see net.minecraft.item.ToolItem
@see net.minecraft.item.BowItem
@see net.minecraft.item.ArmorItem

Pull dropped {@link net.minecraft.entity.item.EntityItem EntityItem}s from the world above the hopper and items from any inventory attached to this hopper into the hopper's inventory.

@param hopper the hopper in question
@return whether any items were successfully added to the hopper

Handles slot click. Args : slotId, clickedButton, mode (0 = basic click, 1 = shift click, 2 = Hotbar, 3 = pickBlock, 4 = Drop, 5 = ?, 6 = Double click), player

@param slotId Will be either the slot id in the current Container or -999 if dragging
@param mode 0 for basic click, 1 for shift-click, 2 for hotbar, 3 for pickBlock, 4 for drop, 5 for item distribution drag, 6 for double click

Creates and drops the provided item. Depending on the dropAround, it will drop teh item around the player, instead of dropping the item from where the player is pointing at. Likewise, if traceItem is true, the dropped item entity will have the thrower set as the player.

@param dropAround Whether the item is dropped around the player, otherwise dropped in front of the player in the direction the player is pointing at
@param traceItem Whether to trace the item to this player as the thrower

Sets the entity to be leashed to.
Args:
@param par1Entity: The entity to be tethered to.
@param par2: Whether to send an attaching notification packet to surrounding players.

Find a character that separates nbt elements. This is either the character that
separates key/value pairs or the character that separates elements in a list.

@return the index of the character

Attempt to execute a command. This method should return the number of times that the command was executed. If the command does not exist or if the player does not have permission, 0 will be returned. A number greater than 1 can be returned if a player selector is used.

@param sender The person who executed the command. This could be an EntityPlayer, RCon Source, Command Block, etc.
@param rawCommand The raw arguments that were passed. This includes the command name.

Parses a JSON string into a {@link ITextComponent}, with strict parsing.

@see #fromJsonLenient(String)
@see {@link com.google.gson.stream.JsonReader#setLenient(boolean)}

Set the initial values of a new world to create, from the values from an existing world.

Called after construction when a user selects the "Recreate" button.

@param original The world we're copying from

Ensures that a proposed directory name doesn't collide with existing names.
Returns the name, possibly modified to avoid collisions.

@param saveLoader used to check against existing names
@param name the name to check, and possibly adjust (via the method's return)

Generate a GuiYesNo asking for confirmation to delete a world

Called when user selects the ""Delete"" button.

@param selectWorld A reference back to the GuiSelectWorld spawning the GuiYesNo
@param name The name of the world selected for deletion
@param id An arbitrary integer passed back to selectWorld's confirmClicked method

Breaks the block at the given location. Args: x, y, z, dropBlock.

@param x The X co-ordinate for the block
@param y The Y co-ordinate for the block
@param z The Z co-ordinate for the block
@param dropBlock If the block should be dropped in-world
